description:
Verenigd Koninkrijk
Drama / Misdaad
108 minuten

goed

met Nonso Anozie, Natalie Press en Leo Gregory

Het waargebeurde verhaal over de Jamaicaanse wees Cass, geadopteerd en opgevoed in de East End van Londen. Na vele jaren van 
discriminatie vervalt Cass in steeds meer gewelddadigheid. Hierdoor krijgt hij respect, iets wat hij nog nooit heeft gehad. Na 
een mislukte moordpoging op Cass begint hij te twijfelen, doorgaan met vechten zoals de straat hem dat geleerd heeft of zijn 
gewelddadige verleden herzien..
